// frontend-react/src/components/History.jsx
import React, { useState, useEffect } from "react";
import "./History.css";

export default function History() {
  const [records, setRecords] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const [editPlate, setEditPlate] = useState("");
  const [toast, setToast] = useState(null);

  const showToast = (message, type = "success") => {
    setToast({ message, type });
    setTimeout(() => setToast(null), 3000);
  };

  useEffect(() => {
    loadRecords();
  }, []);

  const loadRecords = () => {
    fetch("http://localhost:5000/api/records")
      .then(res => res.json())
      .then(data => setRecords(data))
      .catch(() => showToast("Lỗi tải dữ liệu", "error"));
  };

  const handleDelete = (id) => {
    if (!window.confirm("Xóa bản ghi này?")) return;

    fetch(`http://localhost:5000/api/records/${id}`, { method: "DELETE" })
      .then(res => res.json())
      .then(result => {
        if (result.success) {
          showToast("Đã xóa thành công!", "success");
          loadRecords();
        } else {
          showToast(result.message || "Xóa thất bại", "error");
        }
      })
      .catch(() => showToast("Lỗi kết nối server", "error"));
  };

  const startEdit = (record) => {
    setEditingId(record.id);
    setEditPlate(record.plate_number || "");
  };

  const cancelEdit = () => {
    setEditingId(null);
    setEditPlate("");
  };

  const saveEdit = (id) => {
    const newPlate = editPlate.trim().toUpperCase();
    if (!newPlate) {
      showToast("Biển số không được để trống!", "error");
      return;
    }

    fetch(`http://localhost:5000/api/records/${id}`, {
      method: "PUT",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ plate_number: newPlate })
    })
      .then(res => {
        if (!res.ok) throw new Error();
        return res.json();
      })
      .then(result => {
        if (result.success) {
          showToast("Cập nhật thành công!", "success");
          setEditingId(null);
          loadRecords();
        }
      })
      .catch(() => showToast("Cập nhật thất bại", "error"));
  };

  return (
    <div className="history-container">
      {toast && (
        <div className={`toast ${toast.type}`}>
          {toast.message}
        </div>
      )}

      <div className="history-header">
        <button className="back-btn" onClick={() => window.location.href = "/"}>
          Back to Dashboard
        </button>
        <h1 className="title">LỊCH SỬ PHƯƠNG TIỆN</h1>
        <div style={{ width: 180 }}></div>
      </div>

      {records.length === 0 ? (
        <div className="empty-state">
          <p>Chưa có dữ liệu – cho xe đi qua vạch vàng để lưu nhé!</p>
        </div>
      ) : (
        <div className="table-container">
          <table className="history-table">
            <thead>
              <tr>
                <th>ID Xe</th>
                <th>Biển số</th>
                <th>Loại xe</th>
                <th>Hướng</th>
                <th>Thời gian</th>
                <th>Ảnh toàn cảnh</th>
                <th>Ảnh biển số</th>
                <th>Thao tác</th>
              </tr>
            </thead>
            <tbody>
              {records.map(r => (
                <tr key={r.id}>
                  <td>{r.track_id}</td>
                  <td>
                    {editingId === r.id ? (
                      <input
                        type="text"
                        value={editPlate}
                        onChange={(e) => setEditPlate(e.target.value)}
                        style={{
                          padding: "10px",
                          fontSize: "20px",
                          width: "160px",
                          textAlign: "center",
                          border: "3px solid #ff4081",
                          borderRadius: "8px",
                          background: "rgba(255,255,255,0.9)",
                          color: "#000"
                        }}
                        autoFocus
                      />
                    ) : (
                      <span className="plate-number">{r.plate_number}</span>
                    )}
                  </td>
                  <td>{r.vehicle_type || "N/A"}</td>
                  <td>
                    <span className={`direction-badge ${r.direction === "up" ? "direction-up" : "direction-down"}`}>
                      {r.direction?.toUpperCase()}
                    </span>
                  </td>
                  <td>{new Date(r.detected_at).toLocaleString("vi-VN")}</td>
                  <td>
                    <img
                      src={`http://localhost:5000/${r.full_image_path}`}
                      alt="full"
                      className="vehicle-img"
                      style={{ width: "300px", height: "180px", objectFit: "cover" }}
                    />
                  </td>
                  <td>
                    <img
                      src={`http://localhost:5000/${r.plate_image_path}`}
                      alt="plate"
                      className="plate-img"
                      style={{ width: "200px", height: "100px", objectFit: "contain" }}
                    />
                  </td>
                  <td>
                    {editingId === r.id ? (
                      <>
                        <button className="action-btn save-btn" onClick={() => saveEdit(r.id)}>
                          Save
                        </button>
                        <button className="action-btn cancel-btn" onClick={cancelEdit}>
                          Cancel
                        </button>
                      </>
                    ) : (
                      <>
                        <button className="action-btn edit-btn" onClick={() => startEdit(r)}>
                          Edit
                        </button>
                        <button className="action-btn delete-btn" onClick={() => handleDelete(r.id)}>
                          Delete
                        </button>
                      </>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
